{
    const parmas=useParams();
    const {id}=parmas;
    const cabAgencyId=id;
    console.log("template variabe"+cabAgencyId)

    useEffect(()=>{
        getCabAgencyDetails();
    })


    getCabAgencyDetails()
    {
        cabAgencyService.getCabAgencyDetailsService()
    }


